import React from "react";
import '../css/AboutMe.css'

const AboutMe = ()=>{
    return (
        <div className="about-me" id="aboutMe">
            <h3><span>01.</span>  About Me</h3>
            <p>My name is Nguyen Vu Thinh a senior student at the University of Information and Technology. My interest is in making applications that serve daily life or education work and learning how to make a system or framework from scratch.

Although I don't have a clear pathway for my career, I'm eager to learn new things and take chances in different fields.</p>
        </div>
    );
}

export default AboutMe;
